def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
log.info(context.testCase);
def holder = groovyUtils.getXmlHolder( mockRequest.requestContent );
holder.namespaces["uk"] = "http://uk.gov.dwp.maps";

context.ClientRequestId = holder.getNodeValue("//uk:ClientRequestId");
context.UserId = holder.getNodeValue("//uk:UserId");
context.Benefit = holder.getNodeValue("//uk:Benefit");
context.Operation = holder.getNodeValue("//uk:Operation");
context.IPAddress = holder.getNodeValue("//uk:IPAddress");
context.HostName = holder.getNodeValue("//uk:HostName");
context.RequestDateTime = holder.getNodeValue("//uk:RequestDateTime");
if(holder.getNodeValue("//uk:ClientRequestId") == "AA111111C"){
	// For already allocated assessment - business exception - return status 500 and fault code 9001
	return "ResponseFault";
}else if(holder.getNodeValue("//uk:ClientRequestId") == "AA111111Z"){

	return "ResponseFault_9002";
}else if(holder.getNodeValue("//uk:ClientRequestId") == "AA111111Y"){

	return "ResponseFault_9003";
} else if(holder.getNodeValue("//uk:ClientRequestId") == "AA111111F"){

	return "ResponseFault_400";
}else{
	return "Response 1";
}

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
log.info(context.testCase);
def holder = groovyUtils.getXmlHolder( mockRequest.requestContent );
holder.namespaces["uk"] = "http://uk.gov.dwp.maps";
if(holder.getNodeValue("//uk:NINO") == "FF777777F"){
	// NINO Search - 2 records
	return "Response 4";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777L"){
	// NINO Search - for fault allocation - Response 3
	return "Response 19";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777I"){
	// NINO Search - 4 records - 2 with Lot Id 1, 2 with Lot Id 2
	return "Response 13";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777K"){
	// NINO Search - 2 records - 1 with Lot Id 1, 1 with Lot Id 2
	return "lotid_mismatch_real_response";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777J"){
	// NINO Search - 4 records - with Lot Id 2
	return "Response 14";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777E"){
	// NINO Search - 1 record
	return "Response 5";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777G"){
	// NINO Search - no record
	return "Response 6";
}else if(holder.getNodeValue("//uk:NINO") == "FF777777H"){
	// NINO Search - 1 record - to test fault allocations
	return "Response 7"
}else if(holder.getNodeValue("//uk:CRN") == "123456789012345678"){
	// CRN Search
	return "Response 8"
}else if(holder.getNodeValue("//uk:NINO") == "MA000001A"){
	// Real Service Response
	return "Response 9"
}else if(holder.getNodeValue("//uk:NINO") == "MA000001B"){
	// Data null check
	return "Response 10"
}else if(holder.getNodeValue("//uk:NINO") == "MA000001C"){
	// missing allocated user id
	return "Response 12"
//}else if(holder.getNodeValue("//uk:AllocatedUserId") == "46004105"){
